import React from 'react'
import { Paper, TextField, Grid } from "@material-ui/core"

class Item extends React.Component {
    render(){
        return (
            <Paper style = {{margin : 16, padding : 16}}>
                <Grid container>
                    <Grid xs = {11} md = {11} item style = {{paddingRight : 16}}>
                        title : 
                        <TextField/>
                    </Grid>
                </Grid>
            </Paper>
        )
    }
}

export default Item;
